"help_LAN" : "Страница <b>LAN</b> предназначена для изменения параметров локального интерфейса маршрутизатора.<br />В разделе <b>Статический DHCP</b> Вы можете задать связки IP-адресов и MAC-адресов.<br />В разделе <b>DHCP-сервер</b> Вы можете настроить встроенный DHCP-сервер маршрутизатора.",
"help_ex_LAN" : "Если необходимо, измените основные параметры локального интерфейса.<br /><table> <tr> <th>Параметр</th> <th>Описание</th> </tr> <tr> <td><b>IP-адрес</b></td> <td>IP-адрес маршрутизатора в локальной подсети.</td> </tr> <tr> <td><b>Сетевая маска</b></td> <td>Маска локальной подсети.</td> </tr> </table>После задания всех необходимых значений нажмите кнопку <b>Сохранить</b>.<br /><br />В разделе <b>Статический DHCP</b> Вы можете задать связки IP-адресов и MAC-адресов (назначить постоянный IP-адрес в локальной сети для устройства с определенным MAC-адресом). Маршрутизатор назначает IP-адреса в соответствии с созданными связками, только если DHCP-сервер включен (в разделе <b>DHCP-сервер</b> в списке <b>Режим</b> выделено значение <b>Разрешить</b>).<br />Чтобы создать связку MAC-IP, нажмите кнопку <b>Добавить</b> и задайте следующие параметры:</br><table> <tr> <th>Параметр</th> <th>Описание</th> </tr> <tr> <td><b>IP-адрес</b></td> <td>IP-адрес, который будет присвоен устройству с заданным MAC-адресом.</td> </tr> <tr> <td><b>MAC-адрес</b></td> <td>MAC-адрес устройства из локальной сети.</td> </tr> </table>После задания необходимых связок MAC-IP нажмите кнопку <b>Сохранить</b>. <br />Существующие связки MAC- и IP-адресов отображены в таблице раздела <b>Статический DHCP</b>. Чтобы удалить связку, выделите соответствующую строку в таблице и нажмите кнопку <b>Удалить</b>. Затем нажмите кнопку <b>Сохранить</b>.<br /><br />В разделе <b>DHCP-сервер</b> Вы можете настроить встроенный DHCP-сервер маршрутизатора.<br /><table> <tr> <th>Параметр</th> <th>Описание</th> </tr> <tr> <td><b>Режим</b></td> <td>Режим работы DHCP-сервера маршрутизатора.<br /><b>Разрешить</b> – маршрутизатор автоматически назначает IP-адреса клиентам на основании заданных параметров. При выборе этого значения на странице отображаются поля <b>Начальный IP</b>, <b>Конечный IP</b> и <b>Время аренды</b>.<br /><b>Запретить</b> – DHCP-сервер маршрутизатора выключен, IP-адреса клиентам назначаются вручную.</br><b>Relay</b> – для назначения IP-адресов клиентам используется внешний DHCP-сервер. При выборе этого значения на странице отображается поле <b>IP внешнего DHCP-сервера</b>.</td> </tr> <tr> <td><b>Начальный IP</b></td> <td>Начальный IP-адрес пула адресов, которые DHCP-сервер выдает клиентам.</td> </tr> <tr> <td><b>Конечный IP</b></td> <td>Конечный IP-адрес пула адресов, которые DHCP-сервер выдает клиентам.</td> </tr><tr> <td><b>Время аренды</b></td> <td>Период времени, на который DHCP-сервер маршрутизатора предоставляет IP-адрес клиенту (по истечении этого периода IP-адрес отзывается и может быть отдан другому устройству, если не поступило подтверждение о необходимости сохранения этого IP-адреса).</td> </tr><tr> <td><b>IP внешнего DHCP-сервера</b></td> <td>IP-адрес внешнего DHCP-сервера, который назначает IP-адреса клиентам маршрутизатора.</td> </tr></table>После задания всех необходимых значений нажмите кнопку <b>Сохранить</b>.",
