"quickInfoDSL3" : "Пожалуйста, убедитесь, что индикатор DSL горит. Если кабель подключен правильно, но индикатор не горит, возможно, Ваша линия не подключена к оборудованию провайдера. Если индикатор мигает, это значит, что инициализация DSL еще не закончилась. Подождите несколько минут и повторите проверку.",
